import React, { Component } from 'react';

class FarmerEdit extends Component {

    farmerDetails = {
        name: '',
        district: '',
        contact: '',
        landMapping: ''
    };

    constructor(props) {
        super(props);
        this.state = {farmerDetails : this.farmerDetails};
    }

    componentDidMount() {
        fetch('/api/farmer')
            .then(response => response.json())
            .then(data => this.setState({farmerDetails: data}));
    }

}

export default FarmerEdit
